        fetch(countiesUrl)
        .then(response => response.json())
        .then(responseData =>{
          displayCounties = responseData.map(function(counties){
            return(

                  <p>{counties.name}</p>
            )            
          })
          console.log(responseData)
          setshowPosts(displayCounties)

        })

      }


      useEffect(()=>{

          news()

      },[])














